import React, { useState, useEffect } from 'react';
import Grid from "@mui/material/Grid";
import Card from "@mui/material/Card";
import Icon from "@mui/material/Icon";

// Argon Dashboard 2 MUI components
import MDBox from "components/ArgonBox";
import MDTypography from "components/ArgonTypography";
import MDButton from "components/ArgonButton";
import MDAlert from "components/ArgonAlert";

// Argon Dashboard 2 MUI example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
import Footer from "examples/Footer";

// Mock data - replace with actual backend data
const mockInstitutionData = [
  { 
    id: 1, 
    name: "Central Primary School", 
    type: "Education", 
    complianceScore: 75, 
    isCompliant: true 
  },
  { 
    id: 2, 
    name: "Community Health Center", 
    type: "Healthcare", 
    complianceScore: 45, 
    isCompliant: false 
  },
  { 
    id: 3, 
    name: "Local Government Office", 
    type: "Government", 
    complianceScore: 90, 
    isCompliant: true 
  },
];

function ComplianceAnalytics() {
  const [institutions, setInstitutions] = useState(mockInstitutionData);
  const [nonCompliantInstitutions, setNonCompliantInstitutions] = useState([]);

  useEffect(() => {
    // Filter non-compliant institutions
    const nonCompliant = institutions.filter(inst => inst.complianceScore < 60);
    setNonCompliantInstitutions(nonCompliant);
  }, [institutions]);

  const renderComplianceCard = (institution) => (
    <Grid item xs={12} key={institution.id}>
      <Card>
        <MDBox p={2} display="flex" justifyContent="space-between" alignItems="center">
          <MDTypography variant="h6">{institution.name}</MDTypography>
          <MDBox>
            <MDTypography 
              variant="caption" 
              color={institution.isCompliant ? "success" : "error"}
            >
              Compliance: {institution.complianceScore}%
            </MDTypography>
          </MDBox>
        </MDBox>
      </Card>
    </Grid>
  );

  return (
    <DashboardLayout>
      <DashboardNavbar />
      <MDBox my={3}>
        <MDBox>
          <MDTypography variant="h4" mb={2}>AI Compliance Analytics</MDTypography>

          {nonCompliantInstitutions.length > 0 && (
            <MDAlert color="error" dismissible>
              {nonCompliantInstitutions.length} Institutions Require Immediate Attention
            </MDAlert>
          )}

          <Grid container spacing={2}>
            <Grid item xs={12}>
              <MDBox display="flex" justifyContent="space-between" alignItems="center" mb={2}>
                <MDTypography variant="h6">Non-Compliant Institutions</MDTypography>
                <MDButton color="error" size="small">
                  <Icon>warning</Icon> Generate Compliance Report
                </MDButton>
              </MDBox>
            </Grid>

            {nonCompliantInstitutions.map(renderComplianceCard)}
          </Grid>

          <MDBox mt={4}>
            <MDTypography variant="h6">Compliance Overview</MDTypography>
            <Grid container spacing={2}>
              <Grid item xs={4}>
                <Card>
                  <MDBox p={2} textAlign="center">
                    <MDTypography variant="h3" color="success">
                      {Math.round((institutions.filter(i => i.isCompliant).length / institutions.length) * 100)}%
                    </MDTypography>
                    <MDTypography variant="caption">Overall Compliance</MDTypography>
                  </MDBox>
                </Card>
              </Grid>
              <Grid item xs={4}>
                <Card>
                  <MDBox p={2} textAlign="center">
                    <MDTypography variant="h3" color="error">
                      {nonCompliantInstitutions.length}
                    </MDTypography>
                    <MDTypography variant="caption">Non-Compliant Institutions</MDTypography>
                  </MDBox>
                </Card>
              </Grid>
              <Grid item xs={4}>
                <Card>
                  <MDBox p={2} textAlign="center">
                    <MDTypography variant="h3">
                      {institutions.length}
                    </MDTypography>
                    <MDTypography variant="caption">Total Institutions</MDTypography>
                  </MDBox>
                </Card>
              </Grid>
            </Grid>
          </MDBox>
        </MDBox>
      </MDBox>
      <Footer />
    </DashboardLayout>
  );
}

export default ComplianceAnalytics;
